definition.precondition:
- the elevator must be at the origin floor;
- the destination floor must be the immediately lower floor;
- the elevator door must be closed.

- the elevator must be at the passenger's origin floor;
- the elevator door must be open.
- the passenger must be outside an elevator;
- the passenger must be not served, i. e., he must be at his origin floor.

- the passenger must be inside the elevator;
- the elevator door must be open;
- the elevator must be at the passenger's destination floor.

definition.postcondition:
- the passenger is outside the elevator;
- the passenger is served;
- the elvator load decreases.

definition.precondition:
- the elevator must be at the origin floor;
- the destination floor must be the immediately upper floor;
- the elevator door must be closed.
